import React from "react";

const QuoteBox = (props) => {
  const { quote, author, isLoading, onNewQuote, onLanguageChange, onFavorite, onSearch, searchPlaceholder, onBackgroundColorChange, onFontSizeChange, newQuoteBtn, tweetBtn, tumblrBtn, facebookBtn, favoriteBtn, favorites, searchQuery, language } = props;

  console.log(quote);
  // Find a random quote from the list of quotes
     const getRandomQuote = () => {
    const randomIndex = Math.floor(Math.random() * quote.length);
    return { quote: quote[randomIndex], author: author[randomIndex] };

     }

  // Find all quotes that match the search query
  const getFilteredQuotes = () => {
    if (!searchQuery) {
      return [getRandomQuote()];
    }
    return quote.reduce((acc, q, index) => {
      if (q.toLowerCase().includes(searchQuery.toLowerCase())) {
        acc.push({ quote: q, author: author[index] });
      }
      return acc;
    }, []);
  };

  // Display a loading message while fetching new quotes
  if (isLoading) {
    return <p>Loading...</p>;
  }

  // Get the list of quotes to display based on the search query
  const quotes = getFilteredQuotes();

  // If no quotes match the search query, display a message
  if (quotes.length === 0) {
    return <p>No quotes found</p>;
  }

  // Display the first quote from the list of quotes
  const { quote: currentQuote, author: currentAuthor } = quotes[0];

  return (
    <div className="QuoteBox" style={{ backgroundColor: props.backgroundColor, fontSize: props.fontSize }}>
      <div className="quote">
        <p>{currentQuote}</p>
        <span>{currentAuthor}</span>
      </div>
      <div className="buttons">
        <button onClick={onNewQuote}>{newQuoteBtn}</button>
        <button onClick={onFavorite}>{favoriteBtn}</button>
        <a href={`https://twitter.com/intent/tweet?text=${currentQuote}`} target="_blank" rel="noopener noreferrer">{tweetBtn}</a>
        <a href={`https://www.tumblr.com/widgets/share/tool?posttype=quote&tags=quotes&caption=${currentAuthor}&content=${currentQuote}`} target="_blank" rel="noopener noreferrer">{tumblrBtn}</a>
        <a href={`https://www.facebook.com/sharer/sharer.php?u=${window.location.href}`} target="_blank" rel="noopener noreferrer">{facebookBtn}</a>
      </div>
      <div className="options">
        <input type="text" placeholder={searchPlaceholder} value={searchQuery} onChange={onSearch} />
        <select value={language} onChange={onLanguageChange}>
          <option value="en">English</option>
          <option value="es">Español</option>
          <option value="fr">Français</option>
        </select>
        <label htmlFor="background-color">Background Color:</label>
        <input type="color" id="background-color" value={props.backgroundColor} onChange={onBackgroundColorChange} />
        <label htmlFor="font-size">Font Size:</label>
        <input type="range" id="font-size" min="12" max="24" value={props.fontSize} onChange={onFontSizeChange} />
      </div>
      <div className="favorites">
        <h3>Favorites</h3>
        <ul>
            {favorites.map((favorite, index) => (
                <li key={index}>{favorite}</li>
            ))}
        </ul>
        </div>
    </div>
    );
};

export default QuoteBox;
